/////////绘图相关函数

function drawOverText() {
    var bg = $G._("bg");
    var oldOverText = $G._("overText");
    if(oldOverText!=undefined) {oldOverText.remove();} 
    var overStrText = $.createComment('Game Over',{x:bg.x+300,y:bg.y+120,fontsize:50,lifeTime:0,parent:bg,color:0xf9f6f2});
    $G._set("overText", overStrText);
}

function drawOverGrade() {
    var max = 0;
    var datas = $G._("data");
    for (var i = 15; i >= 0; i--){
        if(datas[i]>max){
	    max=datas[i];
	}
    }
    trace(max);
    var bg = $G._("bg");
    var oldGradeText = $G._("gradeText");
    if(oldGradeText!=undefined) {oldGradeText.remove();} 
    var grades = $G._("grades");
    var overGradeText = $.createComment('水平:' + grades[max].name,{x:bg.x+350,y:bg.y+240,fontsize:20,lifeTime:0,parent:bg,color:0xc2aca0});
    $G._set("gradeText", overGradeText);
    var oldGradeContext = $G._("gradeContext");
    if(oldGradeContext!=undefined) {oldGradeContext.remove();} 
    var overGradeContext = $.createComment(grades[max].context,{x:bg.x+100,y:bg.y+20,fontsize:25,lifeTime:0,parent:bg,color:0xc2aca0});
    $G._set("gradeContext", overGradeContext);
}

function drawOverScore() {
    var bg = $G._("bg");
    var oldOverScoreText = $G._("overScore");
    if(oldOverScoreText!=undefined) {oldOverScoreText.remove();} 
    var overScoreText = $.createComment('总分:' + $G._("score"),{x:bg.x+350,y:bg.y+200,fontsize:20,lifeTime:0,parent:bg,color:0xc2aca0});
    $G._set("overScore", overScoreText);
}

function drawScoreBoard(bg) {
    var scoreStrText = $.createComment('score:',{x:bg.x+20,y:bg.y+50,fontsize:30,lifeTime:0,parent:bg,color:0xc2aca0});
    $G._set("scoreStrText", scoreStrText);
}

function drawScore() {
    var bg = $G._("bg");
    var oldScore = $G._("scoreText");
    if(oldScore!=undefined) {oldScore.remove();} 
    var score = $G._("score");
    var scoreStrText = $.createComment(score,{x:bg.x+20,y:bg.y+100,fontsize:50,lifeTime:0,parent:bg,color:0xc2aca0});
    $G._set("scoreText", scoreStrText);
}

function drawCard(map, i, x, y) {
    var cards=$G._get("cardTerms");
    map.graphics.beginFill(cards[i].bcolor);
    map.graphics.drawRoundRect(x,y,100,100,10,10);
    map.graphics.endFill();
    var font=25;
    if (cards[i].num>99999) {
        font= 25;
    } else if (cards[i].num>9999) {
        font= 30;
    } else if (cards[i].num>999) {
	font= 35;
    } else if (cards[i].num>99) {
	font= 40;
    } else {
        font = 60;
    }
    var comments=$G._("comments");
    var bown = $.createComment(cards[i].num,{x:x+cards[i].x+200,y:y+cards[i].y+50,fontsize:font,lifeTime:0,parent:map,color:cards[i].tcolor});
    comments.push(bown);
    $G._set("comments", comments);
}

function drawMap() {
    var bg=$G._get("bg");
    var map=$G._("map");
    if(map!=undefined) {map.remove();}
    var comments=$G._("comments");
    while(true){
        var c = comments.pop();
	if(c!=undefiend){
	    c.remove();
	} else {
	    break;
	}
    }
    var m = $.createShape({x:200,y:50,lifeTime:0,parent:bg});
    $G._set("map",m);
    m.graphics.beginFill(0xccc0b2);
    m.graphics.drawRoundRect(0,0,400,400,10,10);
    m.graphics.endFill();
    for (var i = 0; i < $G._get("num"); i++) {
        for (var j = 0; j < $G._get("num"); j++) {
            m.graphics.lineStyle(10, 0xbbaca0, 1, false, "vertical","none", "miter", 10);
	    m.graphics.drawRoundRect(i*100,j*100,100,100,10,10);
        }
    }
    for (var i = 15; i >= 0; i--){
    	var x = Math.floor(i/4);
	var y = i%4;
      var datas=$G._get("data");
      if (datas[i]==-1) {
          continue;
      }
      drawCard(m,datas[i],x*100, y*100);
    }
}

function clearAll(){
    var map=$G._("map");
    if(map!=undefined) {map.remove();}
    var comments=$G._("comments");
    while(true){
        var c = comments.pop();
	if(c!=undefiend){
	    c.remove();
	} else {
	    break;
	}
    }
    var scoreText = $G._("scoreText");
    if(scoreText!=undefined) {scoreText.remove();}
    var scoreStrText=$G._("scoreStrText");
    if(scoreStrText!=undefined) {scoreStrText.remove();}
    var overText=$G._("overText");
    if(overText!=undefined) {overText.remove();}
    var overScore=$G._("overScore");
    if(overScore!=undefined) {overScore.remove();}
    var restarBtn=$G._("restarBtn");
    if(restarBtn!=undefined) {restarBtn.remove();}
    var gradeText=$G._("gradeText");
    if(gradeText!=undefined) {gradeText.remove();}
    var gradeContext=$G._("gradeContext");
    if(gradeContext!=undefined) {gradeContext.remove();}
}
